    data: |
      SELECT + + col1 * - + col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - col1 ) BETWEEN + + 46 AND + - CAST ( - - 63 AS INTEGER );
  - name: tab1

outputs:
  - name: q10140.out
    data: |
